import React from 'react';
import { View, Text, Button } from 'react-native';
import { createStackNavigator } from '@react-navigation/stack';
import Driving from './path_to_Driving';
import Energy from './path_to_Energy';

const Stack = createStackNavigator();

function TrackOptions({ navigation }) {
    return (
        <View>
            <Text>Choose an option:</Text>
            <Button
                title="Driving"
                onPress={() => navigation.navigate('Driving')}
            />
            <Button
                title="Energy"
                onPress={() => navigation.navigate('Energy')}
            />
        </View>
    );
}

function TrackNav() {
    return (
        <Stack.Navigator>
            <Stack.Screen
                name="Track"
                component={TrackOptions}
            />
            <Stack.Screen
                name="Driving"
                component={Driving}
            />
            <Stack.Screen
                name="Energy"
                component={Energy}
            />
        </Stack.Navigator>
    );
}

export default TrackNav;
